import React from "react";
import "../css/cadr.css";
const CardEdukacija = () => {
  return (
    <div className="card">
        <div className="eduImg"></div>
        <div>
            <h3>Едукација</h3>
            <p>Научи практични вештини за трансформација во кариерата.</p>
        </div>
    </div>
  );
};

export default CardEdukacija;
